def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = False
    for char in prefix:
        current_line += char
        if wait_for_nl:
            # Handle newline inside comment continuation
            if char == '\n':
                wait_for_nl = False
            continue

        if char == ' ':
            current_column += 1
        elif char == '\t':
            current_column += 4
        elif char == '\n':
            # Check if we reached the specified column
            if current_column >= column:
                res = ''.join(lines)
                return res, prefix[len(res):]
            current_column = 0
        elif char == '#':
            # Start of a comment, skip newline if present
            wait_for_nl = True
        else:
            # Indent is finished
            wait_for_nl = False
        lines.append(current_line)
        current_line = ""

    return ''.join(lines), current_line
